import React, { Component } from 'react';
import RestaurantViewContainer from "./containers/RestaurantViewContainer";
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import {NewBookingContainer as NewBooking} from "./Components/NewBookingComponent.js";

import './App.css';
import NavBar from "./NavBar.js";

class App extends Component {
  render() {
    return (
      <Router >
        <React.Fragment>
          <NavBar />
          <Switch>
            <Route exact path = "/" component={RestaurantViewContainer} />
              <Route exact path="/newbooking/:id" render = {(props) =>{
                const id = props.match.params.id;
                return <NewBooking id = {id} />
                }}
              />
          </Switch>
        </React.Fragment>
    </Router>
    );
  }
}

export default App;
